import './App.css';
import Home from './components/Home';
import Login from './components/Login';
import Error from './components/Error';
import React from 'react';
import Header from './components/Headers';
import Student_home from './components/student/student_home';
import Teacher_home from './components/teacher/teacher_home';
import Project_bank from './components/common/project_bank';

import { Route, Routes, useLocation } from 'react-router-dom';

function App() {
  const location = useLocation();
  const isLoginPage = location.pathname === '/login';

  return (
    <>
      {!isLoginPage && <Header />}
      <Routes>
        <Route path="/Home" element={<Home />} />
        <Route path= "/project_bank" element={<Project_bank />} />
        <Route path="/student_home" element={<Student_home />} />
        <Route path="/student_profile" element={<Student_home />} />
        <Route path="/teacher_home" element={<Teacher_home />} />
        <Route path="/teacher_profile" element={<Student_home />} />
        <Route path= "/project_bank" element={<Project_bank />} />
        <Route path="*" element={<Error />} />
      </Routes>
    </>
  );
}



export default App;
